import React from 'react';
import { Grid, Paper } from '@mui/material';

export default function Header() {
  return (
    <Paper elevation={10}>
      <h1 style={{ fontFamily: 'Montserrat', textAlign: 'center', margin: 0 }}>
        Create An Account
      </h1>
      <p style={{ fontFamily: 'Montserrat', textAlign: 'center', margin: 0 }}>
        Already have an account?{' '}
        <a
          href="/login"
          style={{ 'text-decoration': 'none', color: 'inherit' }}
        >
          Log in
        </a>
      </p>
    </Paper>
  );
}
